import { NgModule } from '@angular/core';
import { RouterModule, Routes } from '@angular/router';
import { TeacherRegistrationComponent } from './Teachers/teacher-registration/teacher-registration.component';
import { TeachersModule } from './Teachers/teachers.module';
import { StudentsModule } from './students/students.module';
import { ShredModule } from './shared/shred.module';

const routes: Routes = [
  {path:'login',loadChildren:()=>import('./shared/shred.module').then(m=>ShredModule)},
  {path:'teacher', loadChildren:()=>import('./Teachers/teachers.module').then(m=>TeachersModule)},
  {path:'student', loadChildren:()=>import('./students/students.module').then(m=>StudentsModule)}
];

@NgModule({
  imports: [RouterModule.forRoot(routes)],
  exports: [RouterModule]
})
export class AppRoutingModule { }
